function biasan_Callback(hObject, eventdata, handles)
lambda1 = str2double(get(handles.elambda1,'string'));
lambda2 = str2double(get(handles.elambda2,'string'));
nu  = 30/(lambda1*1e-7);  % photon frequency mode 1
nu2 = 30/(lambda2*1e-7);  % photon frequency mode 2

bias =(1+ sin(2*pi*nu*((0.1:0.001:.35)*1e-3))+sin(2*pi*nu2*((0.1:0.001:.35)*1e-3)));
figure(2)
plot(bias,'displayname','Input Bias in Two-tone modulation');xlabel('time');ylabel('Amplitude');title('Input Bias in Two-tone modulation');
